import { FC } from "react";
import { useActions } from "../../hooks/useActions";
import { moveCell, deleteCell } from "../../store/action-creators/index";

interface ActionBarProps {
  id: string;
}

const ActionBar: FC<ActionBarProps> = ({ id }) => {
  const { moveCell, deleteCell } = useActions();
  return (
    <div>
      <button onClick={() => moveCell(id, "up")}>Вверх</button>
      <button onClick={() => moveCell(id, "down")}>Вниз</button>
      <button onClick={() => deleteCell(id)}>Удалить</button>
    </div>
  );
};

export default ActionBar;
